import React from "react";
import './Img.css'
import tenisImg from './Air-Jordan-capa.png'

export function Img() {
    return (
        <div className="img">
            <img src={tenisImg} />
            <div className="textImg">
                <h2>A melhor loja de Jordan</h2>
                <p>O tênis Jordan é fruto de uma velha e forte <br />parceria
                    entre a Nike e o jogador Michael Jordan.</p>
            </div>
        </div>
    )
}
